Материал: тритан
Емкость: 500 мл;
Размер: d6,5 х 23,2 см
Нанесение: УФ-печать с подъемом 4+4;
Упаковка: Индивидуальная фирменная коробка + шубер (бумага мелованная, матовая, печать 4+0) / брендированная коробка из картона, печать 4+0;                         КАСТОМ ОТ 1000ШТ (В НАЛИЧИИ НЕТ, ВСЕ ПРОИЗВОДСТВО)
